import React, { useEffect, useState } from 'react';
import {useParams, useLocation, Route, Routes, useNavigate} from 'react-router-dom';
import "./Patients.css";
import Tooth from "./Tooth";
import "./Patient.css" ;
import teethChart from '../../icons/teeth_chart.png'

const Patient = () => {
    const navigate = useNavigate();
    const { id } = useParams();
    const location = useLocation();
    const patient = location.state?.patient;

    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    const [selectedTooth, setSelectedTooth] = useState(null); // Dintele selectat
    const [teeth, setTeeth] = useState([]);

    useEffect(() => {
        if (patient) {
            setFirstName(patient.firstName);
            setLastName(patient.lastName);
            setPhoneNumber(patient.phoneNumber);
            setTeeth(patient.teeths);
        } else {
            // Fetch patient data from API if not passed through state
            fetch(`/api/patients/${id}`)
                .then(res => res.json())
                .then(data => {
                    setFirstName(data.firstName);
                    setLastName(data.lastName);
                    setPhoneNumber(data.phoneNumber);
                })
                .catch(error => console.error("Error fetching patient:", error));
        }
    }, [patient, id]);

    const handleImageUpload = (event) => {
        const file = event.target.files[0];
        setImageFile(file);

        // Creează o previzualizare locală a imaginii
        const reader = new FileReader();
        reader.onload = (e) => setPreviewImage(e.target.result);
        reader.readAsDataURL(file);
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        if (!imageFile) {
            alert("Please upload an image before submitting.");
            return;
        }

        // Encodează imaginea în Base64
        const reader = new FileReader();
        reader.onload = async () => {
            const imageBase64 = reader.result.split(',')[1]; // Extrage doar partea Base64

            const payload = {
                patient_data: { firstName, lastName, phoneNumber, teeth },
                image: imageBase64
            };

            try {
                const response = await fetch("/api/upload", {
                    method: "POST",
                    headers: { "Content-Type": "application/json" },
                    body: JSON.stringify(payload)
                });

                const data = await response.json();
                console.log("Server response:", data);
            } catch (error) {
                console.error("Error uploading patient:", error);
            }
        };
        reader.readAsDataURL(imageFile);
    };

    const handleToothClick = (tooth) => {
        console.log(`Teeth clicked`);
        console.log(`Florinas`);
        console.log(tooth);
        console.log(`Teeth lenght`);
        setSelectedTooth(tooth);
        console.log(teeth.length);
        teeth.forEach((toothObj) => {
            console.log(toothObj); // Fiecare obiect din lista teeth
        });
    };

    return (
        <div className='main-content'>
            <div className='left-content'>

                    <div className="chart_img">



                        {/* Crearea butoanelor din 1 până la 32 */}
                        {Array.from({ length: 32 }, (_, index) => {
                            const toothNumber = index + 1;
                            const tooth = teeth.find((t) => t.name === toothNumber.toString());
                            const isExisting = teeth.some((tooth) => tooth.name === toothNumber.toString()); // Verifică dacă toothNumber este egal cu tooth.name

                            return (
                                <button
                                    key={index}
                                    className={`teeth_buton  ${isExisting ? "isExisting" : "isMissing"} teeth_buton${toothNumber}`}
                                    onClick={() => handleToothClick(tooth)}
                                >
                                 {`${toothNumber}`}
                                </button>
                            );
                        })}
                        {/*<ul>*/}
                        {/*    {teeth.map((tooth) => (*/}
                        {/*        <li*/}
                        {/*            key={tooth.id}*/}
                        {/*            onClick={() => handleToothClick(tooth)} // Setăm dintele selectat*/}
                        {/*            // style={{*/}
                        {/*            //     cursor: "pointer",*/}
                        {/*            //     color: selectedTooth?.id === tooth.id ? "blue" : "black",*/}
                        {/*            // }}*/}
                        {/*        >*/}
                        {/*            Dintele {tooth.name}*/}
                        {/*        </li>*/}
                        {/*    ))}*/}
                        {/*</ul>*/}
                    </div>

                <div className="patient-form">

                </div>
                </div>





            {/* Partea dreaptă - Detalii dinte */}
            <div className="right-content">
                <form onSubmit={handleSubmit} className="patient-form">

                        <input
                            className="input-bar"
                            type="text"
                            value={firstName}
                            onChange={(e) => setFirstName(e.target.value)}
                            placeholder="Prenume"
                            required
                        />
                        <input
                            className="input-bar"
                            type="text"
                            value={lastName}
                            onChange={(e) => setLastName(e.target.value)}
                            placeholder="Nume de familie"
                            required
                        />
                        <input
                            className="input-bar"
                            type="text"
                            value={phoneNumber}
                            onChange={(e) => setPhoneNumber(e.target.value)}
                            placeholder="Număr de telefon"
                            required
                        />


                    <input type="file" accept="image/*" onChange={handleImageUpload} />
                    {previewImage && <img src={previewImage} alt="Preview" className="image-preview" />}
                    <button type="submit" className="submit-button" onClick={handleSubmit}>
                        Trimite
                    </button>
                </form>




                {selectedTooth ? (
                    <Tooth tooth={selectedTooth} />
                ) : (
                    <p>Selectați un dinte pentru a vedea detalii.</p>
                )}


            </div>




        </div>
    );
};

export default Patient;
